import React, { Component } from 'react';

export class Navbar extends Component {
  render() {
    return (
      <nav className='navbar bg-primary'>
        <h1>
          <i class={this.props.icon} /> {this.props.tittle}
        </h1>
      </nav>
    );
  }
}

export default Navbar;
